import React from 'react'
import AppLayout from './component/AppLayout'
import Head from 'next/head'  //next 에서 head 는 지원해준다.
import NickNameEditForm from './component/NickNameEditForm';
import FollowList from './component/UserProfile'

function profile() {
    const followerList = [{nickName: '김군'}, {nickName:'이군'}, {nickName:'박군'}];
    const followingList = [{nickName: '김군1'}, {nickName:'이군2'}, {nickName:'박군3'}];
    return (
        <>
            <Head>
                <title>profile</title>
            </Head>
            <AppLayout>
                <NickNameEditForm>
                    <FollowList hader="팔로잉목록" data={followerList}/>
                    <FollowList hader="팔로워 목록" data={followingList}/>
                </NickNameEditForm>
            </AppLayout>
        </>
    )
}


export default profile
